import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
function Expenses (props) {
    
    return(

        <div>
            <ExpenseItem 
        title= {props.ti[0].title}
        amount={props.ti[0].amount} 
        date={props.ti[0].date}>
        </ExpenseItem>
        <ExpenseItem 
        title= {props.ti[1].title}
        amount={props.ti[1].amount} 
        date={props.ti[1].date}>
        </ExpenseItem>
        <ExpenseItem 
        title= {props.ti[2].title}
        amount={props.ti[2].amount} 
        date={props.ti[2].date}>
        </ExpenseItem>
        <ExpenseItem 
        title= {props.ti[3].title}
        amount={props.ti[3].amount} 
        date={props.ti[3].date}>
        </ExpenseItem>
        </div>
    )
}

export default Expenses;
